INSERT INTO `lrc_shop_store_css` VALUES ('\n.sc-overlay {\n  position: fixed;\n  top: 50%;\n  left: 50%;\n  transform: translate(-50%, -50%);\n  transform: -webkit-translate(-50%, -50%);\n  transform: -moz-translate(-50%, -50%);\n  transform: -ms-translate(-50%, -50%);\n  color:#1f222b;\n  z-index: 9999;\n  background: rgba(255,255,255,0.7);\n}\n  \n#sc-loading{\n  display: none;\n  position: absolute;\n  top: 0;\n  left: 0;\n  width: 100%;\n  height: 100%;\n  z-index: 50;\n  background: rgba(255,255,255,0.7);\n}\n/*end loading */\n  \n/*price*/\n.sc-new-price{\n  color:#FE980F;\n  font-size: 14px;\n  padding: 10px 5px;\n  font-weight:bold;\n  }\n  .sc-old-price {\n  text-decoration: line-through;\n  color: #a95d5d;\n  font-size: 13px;\n  padding: 10px;\n  }\n  /*end price*/\n.sc-product-build{\n  font-size: 20px;\n  font-weight: bold;\n}\n.sc-product-build img{\n  width: 50px;\n}\n.sc-product-group  img{\n  width: 100px;\n  cursor: pointer;\n  }\n.sc-product-group:hover{\n  box-shadow: 0px 0px 2px #999;\n}\n.sc-product-group:active{\n  box-shadow: 0px 0px 2px #ff00ff;\n}\n.sc-product-group.active{\n  box-shadow: 0px 0px 2px #ff00ff;\n}\n\n.sc-shipping-address td{\n  padding: 3px !important;\n}\n.sc-shipping-address textarea,\n.sc-shipping-address input[type=\"text\"],\n.sc-shipping-address option{\n  width: 100%;\n  padding: 7px !important;\n}\n.row_cart>td{\n  vertical-align: middle !important;\n}\ninput[type=\"number\"]{\n  text-align: center;\n  padding:2px;\n}\n.sc-notice{\n  clear: both;\n  clear: both;\n  font-size: 20px;\n  background: #f3f3f3;\n  width: 100%;\n}\nimg.new {\n  position: absolute;\n  right: 0px;\n  top: 0px;\n  padding: 0px !important;\n}\n.pointer {\n  cursor: pointer;\n}\n.add-to-cart-list {\n  padding: 5px 10px !important;\n  margin: 2px !important;\n  letter-spacing: 0px !important;\n  font-size: 12px !important;\n  border-radius: 5px;\n}\n.help-block {\n  font-size: 12px;\n  color: red;\n  font-style: italic;\n}\n                  ',1);
